@MijaelGLP @Cuarto_Poder @MartinVizcarraC Tu papá era uña y mugre del ladrón suicida y sigue siéndolo de los estrellados involucrados en los Petroaudios.

A que hora los sientas en tu programa o al menos das RT con respecto a eso?

Pan con pavo, sin tu apellido que encima esta manchado y te haces el loco, no eres nadie.

@bracesco22 @ladriguruok No hay ninguna chance de que Larreta pierda. Va a ganar y en primera vuelta con casi el 55% de los votos válidos positivos (sacó 50.5% en PASO)
La Ciudad de Buenos Aires no se suicida
Vidal si, es historia lamentablemente.

